import{_ as p}from"./plugin-vue_export-helper-c27b6911.js";import{o as _,c as e,e as t}from"./app-60a1dd49.js";const o={},c=t("<p>《三命通会》卷 八·六丙日己丑时断</p><p>（以下六丙日所忌月分与上同。时亦并论）</p><p>六丙日生时己丑，官鬼相生禄不成；若见申庚并乙旺，不求财禄过平生。</p><p>丙日己丑时，伤官背禄，傲物志高。</p><p>丙用癸为官，丑中有癸余气，被明暗土伤，柱透癸为祸。</p><p>若见庚辛，伤官生财，却为福庆。</p><p>丙子日己丑时，寅亥申辰年月，天干透财印食者贵。</p><p>丙寅日己丑时，平常，生乙酉月，正财格，有乙庚健旺者贵。</p><p>巳丑年月，干透官印者贵。</p><p>丙辰日己丑时，申亥年月，化水则吉；不化寿促，戌月冲库，无人不发。</p><p>寅午身旺，成火上格，大贵。</p><p>丙午日己丑时，春月，行火金运，官至极品。</p><p>夏平，秋富，冬贵，难为妻子，午酉年月，五六品，此月禄生财之验。</p><p>丙申日巳丑时，血疾。</p><p>申月，文学儒官成。</p><p>卯贵。</p><p>子辰会官，寅卯会印，俱吉。</p><p>丙戌日己丑时高，武刑后发旺。</p><p>生亥卯月，火金运，大贵。</p><p>辰未四库全，火土成局，大富。</p><p>丙日财官库里藏，戌辰未字显文章；身衰若也无匙钥，求名求利总平常。</p><p>丙日时逢己丑，伤官财库暗藏。</p><p>运交未戌不寻常。</p><p>破出财官必旺。</p><p>近贵谋夺劫财，算来虽有害。</p><p>六亲真假少和谐，直断依时莫怪。</p>",26),r=[c];function s(n,a){return _(),e("div",null,r)}const f=p(o,[["render",s],["__file","193卷 八·六丙日己丑时断（以下六丙日所忌月分与上同。时亦并论）.html.vue"]]);export{f as default};
